import React from 'react';
import TotalChart from './components/chart/TotalChart';
import SendReport from './components/buttons/SendReport';
import MoodCheck from './components/buttons/MoodCheck';
import AwaitingTable from './components/tables/AwaitingTable';
import BlockedTable from './components/tables/BlockedTable';

function App() {
  return (
    <div style={{ display: 'flex', backgroundColor: '#f0f0f0', height: '100vh' }}>
      <div style={{ flex: '1', borderRight: '1px solid #ccc', padding: '20px' }}>
        <TotalChart/>
        <SendReport/>
        <MoodCheck/>
      </div>
      <div style={{ flex: '1', borderLeft: '1px solid #ccc', padding: '20px', width: '35%' }}>
        <div style={{ marginBottom: '20px' }}>
          <h2>Awaiting Client Approval Issues</h2>
          <AwaitingTable/>
        </div>
        <div>
          <h2>Blocked Issues</h2>
          <BlockedTable/>
        </div>
      </div>
    </div>
  );
}

export default App;
